## To

简介：使用 m-to 运动一切。

组件链接：[简体中文](https://tencent.github.io/omi/packages/omim/docs/build/cn.html#/to?index=2&subIndex=1 '官网链接') | [English](https://tencent.github.io/omi/packages/omim/docs/build/index.html#/to?index=2&subIndex=1 '官网链接')

---

## 在 Omi 中使用

```jsx
<m-to 
  from={{ number: 1 }} 
  to={{ number: 100 }} 
  duration={600}
  easing='bounce-in' 
  out={this.out} 
  delay={200}
  onProgress={this.onProgress}
  onBegin={this.onProgress}
  onEnd={this.onEnd}>
</m-to>
```

---

