## ColorPicker

简介：基于 [pickr](https://github.com/Simonwep/pickr) 改造得颜色选择器。

组件链接：[简体中文](https://tencent.github.io/omi/packages/omim/docs/build/cn.html#/color-picker?index=5&subIndex=3 '官网链接') | [English](https://tencent.github.io/omi/packages/omim/docs/build/index.html#/color-picker?index=5&subIndex=3 '官网链接')

---

## 使用

```html
<m-color-picker 
  id='picker' 
  save="0" 
  preview="0" 
  button='0' 
  clear='0' 
  width="300px">
</m-color-picker>
<script>
  var picker = document.querySelector('#picker')
  picker.addEventListener('change', function(evt){
    console.log(evt.detail.color)
  })
</script>
```

---

